column8:
スタイリッシュ/スポーツをテーマに、テールエンドから車のデザインを引き立てるフォルムを演出。オールステンレス製、バフ仕上げによる高級感と耐久性を両立。 <br>大型サイレンサーを採用し快適性を損なわない心地よいサウンドとローダウン時のロードクリアランスを確保。<br>テール：107x70Wパイ　メインパイプ：60-50x2パイ　分割数：1　音量：90db　材質：オールステンレス製 <br>対応車種：CBA-ME51 エルグランド　※250V専用。 <br>　車検対応品<br>排気系/マフラー<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


