Wagon＆One boxに重要な中低速でのトルクとクイックなレスポンスを実現し、スタイルにもこだわったスタンダードモデル。インナーサイレンサー無しの小容量砲弾型マフラーでありながらJASMA基準内の音量を保ちつつ、性能を犠牲にすることなく、中低速域におけるトルクとクイックレスポンスを同時に実現するという高機能マフラー。またエアロチューンを意識した遊び心満載のスタイルにこだわったデザインも魅力のひとつ。 <br>●材質：オールステンレス ●パイプ径（パイ）60 ●タイコ径（パイ）127 ●テール径（パイ）93 ●出口：S(左) ●リアピースのみ ●納期：お取り寄せ商品のため通常3～4日でのお届けとなります。(日・祝日は除く)万が一欠品の場合は別途メールにてご連絡差し上げます。お急ぎの場合はご注文前に必ず納期確認を頂きますようお願い申し上げます。<br>【注意事項】○～04/8の車輌はハイウェスター専用　04/8～の車輌はノーマル、ハイウェスター共通　ライダー取付未確認 ○2009年1月以降に製造された車輌は取付未確認 <br>対応車種：04/8～・02/5～ E51 エルグランド 3.5L ノーマルグレード M/C後/ハイウェースターM/C前後 2WD　エンジン型式：VQ35DE  <br>　保安基準適合品（JASMA認定）<br>排気系/マフラー<br>※送料は地域や配達場所によって変わりますが、6000円～12000円程度が目安となります。<tr><td colspan="2">
