120mm×80mmのオーバルテールは、厚すぎず薄すぎない絶妙なバランス。高級感あふれるエレガントさの中にもスポーティーさが見え隠れするスタイルは、カキモトレーシングならではの仕上がり。Ellisseテールは地上高の確保の面でも有利で非常に乗りやすいのが特徴です。また付属のロジウムコートされたグラマラスな厚みのロゴプレートには、オーストリアのスワロフスキー社製クリスタルが贅沢にセッティングされています。<br><br>●メインパイプ径(φ)：60●テール径(φ)：楕円テール(120x80)●テール(出口)：S(左右)●近接排気騒音値：87～90dB●リアピースのみ●ロゴプレート：クリスタルＡＢ<br><br><br><br>対応車種：09/11～ フーガ 350GT タイプS DBA-KY51 (2WD) エンジン型式：VQ37VHR <br><br>JQR認定<br><br>排気系 | マフラー<tr><td colspan="2">
